    int checkURL()
    {
        int ans = 0;
        ans += (numberOfDots() - 1)*5; //Number of dots in URL
        ans += suspiciousURL()*10;
        if(hasIP())
        {
            ans += 50;
            //System.out.println("IP");
        }
        ans += senstiveWords()*10;
        if(outOfPositionTLD())
            ans += 50;
        return ans;
    }
    int perMatch()// to find percentage match with given list of URL
    {
        int l = _url.length(), high = phish_list.length - 1, low = 0, mid, i, flag, ans = 0, maxi = 0;
        while(high >= low)
        {
            flag = 0;
            mid = (high + low) / 2;
            //System.out.println(phish_list[mid]+" "+high+" "+" "+low);
            int len = phish_list[mid].length();
            for(i = 0; i < Math.min(l, len); i++)
            {
                if(_url.charAt(i) != phish_list[mid].charAt(i))
                {
                    flag = 1;
                    break;
                }
            }
            if(flag == 1)
            {
                    if(i > maxi)
                    {
                        ans = mid;
                        maxi = i;
                    }
                    if(_url.charAt(i) > phish_list[mid].charAt(i))
                        low = mid + 1;
                    else
                        high = mid - 1;                        
            } 
            else
            {
                if(i > maxi)
                    {
                        ans = mid;
                        maxi = i;
                    }
            
                break;
            }
        }
        //System.out.println(phish_list[ans]+"  "+_url +maxi+" "+Math.min(l, phish_list[ans].length()));
        int per = maxi*100/phish_list[ans].length();
        return per;
    }

    
    int numberOfDots()
    {
        return (new StringTokenizer(_url, ".")).countTokens() - 1;
    }
    int suspiciousURL()
    {
        int ctr = 0;
        for(int i = 0; i < _url.length(); i++)                        //Suspicious URL
        {
            if(_url.charAt(i) == '@' || _url.charAt(i) == '-' || _url.charAt(i) == '-')
            {
                ctr++;
            }
        }
        return ctr;
    }
    boolean hasIP() 
    {
 
        Pattern p = Pattern.compile("(?:(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)\\.){3}(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)");
        Matcher m = p.matcher(_url);
        return m.find();
    }

    int senstiveWords() 
    {
        String[] words = {"secure", "account", "webscr", "login", "ebayisapi", "signin", "banking", "confirm"};
        int ctr = 0;
        for(String word : words)
        {
            String patternString1 = "("+word+")";
            Pattern pattern = Pattern.compile(patternString1);
            Matcher matcher = pattern.matcher(_url);
            while(matcher.find()) 
            {
                ctr++;
            }
        }
        return ctr;
    }
